package Homeassignments;

public class NonRepeatedNumber {

	public static void main(String[] args) {
		// TODO Auto-generated method stub 
		int i;
		int n[] = {1,2,2,3,4,5,6};
		for(i=0;i<n.length-1;i++) {
				if (n[i]!=n[i+1]) {
	
				System.out.println(n[i]);
			}
			
		}
		}

	}


